sources.styleguide.sass:
@import './variables';

.roboto-medium-white-20px {
  color: $white;
  font-family: $font-family-roboto;
  font-size: $font-size-xxl2;
  font-style: normal;
  font-weight: 500; }

.roboto-medium-blueberry-40px {
  color: $blueberry;
  font-family: $font-family-roboto;
  font-size: $font-size-xxl;
  font-style: normal;
  font-weight: 500; }

.roboto-normal-storm-dust-24px {
  color: $storm-dust;
  font-family: $font-family-roboto;
  font-size: $font-size-xxxl;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-white-16px {
  color: $white;
  font-family: $font-family-roboto;
  font-size: $font-size-l2;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-white-140px {
  font-family: $font-family-roboto;
  font-size: 140px;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-blueberry-18px {
  color: $blueberry;
  font-family: $font-family-roboto;
  font-size: $font-size-xl2;
  font-style: normal;
  font-weight: 400; }

.raleway-bold-white-27px {
  color: $white;
  font-family: $font-family-raleway;
  font-size: 27px;
  font-style: normal;
  font-weight: 700; }

.roboto-medium-cararra-19px {
  color: $cararra;
  font-family: $font-family-roboto;
  font-size: 19px;
  font-style: normal;
  font-weight: 500; }

.roboto-medium-blueberry-26px {
  color: $blueberry;
  font-family: $font-family-roboto;
  font-size: $font-size-l;
  font-style: normal;
  font-weight: 500; }

.fontawesome5free-solid-normal-blueberry-16px {
  color: $blueberry;
  font-family: $font-family-fontawesome5free-solid;
  font-size: $font-size-l2;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-white-18px {
  color: $white;
  font-family: $font-family-roboto;
  font-size: $font-size-xl2;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-blueberry-35px {
  color: $blueberry;
  font-family: $font-family-roboto;
  font-size: $font-size-xl;
  font-style: normal;
  font-weight: 400; }

.roboto-normal-white-16px-2 {
  color: $white;
  font-family: $font-family-roboto;
  font-size: $font-size-l2; }

.prompt-bold-white-20px {
  color: $white;
  font-family: $font-family-prompt;
  font-size: $font-size-xxl2;
  font-style: normal;
  font-weight: 700; }

.opensans-light-blueberry-20px {
  color: $blueberry-2;
  font-family: $font-family-open_sans;
  font-size: $font-size-xxl2;
  font-style: normal;
  font-weight: 300; }

.opensans-bold-blueberry-40px {
  color: $blueberry-2;
  font-family: $font-family-open_sans;
  font-size: $font-size-xxl;
  font-style: normal;
  font-weight: 700; }

.border-1px-white {
  border: 1px solid $white; }

.border-2px-white {
  border: 2px solid $white; }

.border-1px-blueberry {
  border: 1px solid $blueberry; }

sources.variables.sass:
$blueberry: #5b77ff;
$blueberry-2: #3e7ef8;
$cararra: #ebebeb;
$chicago: #5e5d5d;
$dove-gray: #707070;
$storm-dust: #646464;
$white: #ffffff;
$wild-sand: #f3f4f8;
$font-size-l: 26px;
$font-size-l2: 16px;
$font-size-xl: 35px;
$font-size-xl2: 18px;
$font-size-xxl: 40px;
$font-size-xxl2: 20px;
$font-size-xxxl: 24px;
$font-family-fontawesome5free-solid: 'FontAwesome5Free-Solid', Helvetica;
$font-family-open_sans: "Open Sans", Helvetica;
$font-family-prompt: "Prompt", Helvetica;
$font-family-raleway: "Raleway", Helvetica;
$font-family-roboto: "Roboto", Helvetica;
